import LoginLayout from '../Layouts/LoginLayout'
import Home from "@/App";


 const Routers = [
  {
    path: "/",
    element: <LoginLayout />,
    children: [
      // 注意:children 中的path ,前一层路由要和父级保持一致,否则会报错
      { path: "/login", element: <Home /> },
    ],
  },
]

export default Routers;
